import {AbsUserApi} from "../abstract/AbsUserApi";
class SbootUserApi extends AbsUserApi{
    getCurrentUserMenu (loading) {
        //http://10.201.3.20:8891/qb-bjsc/user/menu-tree
        let data = {};
        return this.request({
            url: `/user/menu-tree`,
            method: "GET",
            loading: loading,
            baseURL: this.modulePath,
            params: data
        });
    }
}

export {
    SbootUserApi
}
